import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

const Section = styled.section`
  position: relative;
  background: #fff;
  padding: 4.5rem 1rem 2.5rem 1rem;
  margin-top: -60px;
  z-index: 1;
  @media (max-width: 700px) {
    padding: 2.5rem 0.5rem 1.5rem 0.5rem;
    margin-top: -30px;
  }
`;
const SvgCurve = styled.svg`
  position: absolute;
  top: -1px;
  left: 0;
  width: 100%;
  height: 60px;
  z-index: 2;
  @media (max-width: 700px) {
    height: 30px;
  }
`;
const TitleRow = styled.div`
  display: flex;
  align-items: baseline;
  justify-content: center;
  gap: 1.2rem;
  margin-bottom: 2.2rem;
`;
const TitleNew = styled.span`
  font-family: 'Playfair Display', serif;
  font-size: 2.1rem;
  color: #b08d57;
  font-weight: 600;
  letter-spacing: 0.01em;
`;
const TitleBest = styled.span`
  font-family: 'Playfair Display', serif;
  font-size: 2.1rem;
  color: #ece7df;
  font-weight: 600;
  letter-spacing: 0.01em;
`;
const Highlights = styled(motion.div)`
  display: flex;
  justify-content: center;
  gap: 2.5rem;
  flex-wrap: wrap;
  max-width: 950px;
  margin: 0 auto;
  @media (max-width: 900px) {
    gap: 1.2rem;
  }
`;
const Highlight = styled(motion.div)`
  background: rgba(255,247,237,0.7);
  border-radius: 1.5rem;
  box-shadow: 0 4px 24px rgba(176,141,87,0.08);
  padding: 1.5rem 1.2rem 1.2rem 1.2rem;
  min-width: 210px;
  max-width: 240px;
  display: flex;
  flex-direction: column;
  align-items: center;
  position: relative;
  margin-top: ${({ featured }) => (featured ? '-40px' : '0')};
  z-index: ${({ featured }) => (featured ? 3 : 1)};
  border: ${({ featured }) => (featured ? '2px solid #b08d57' : 'none')};
  @media (max-width: 700px) {
    min-width: 140px;
    max-width: 180px;
    padding: 0.7rem 0.5rem;
    margin-top: 0;
  }
`;
const Img = styled.img`
  width: 110px;
  height: 110px;
  object-fit: cover;
  border-radius: 1rem;
  margin-bottom: 1rem;
  box-shadow: 0 2px 8px rgba(176,141,87,0.10);
`;
const Name = styled.h4`
  color: #7c5e3c;
  font-size: 1.08rem;
  margin-bottom: 0.5rem;
  font-family: 'Montserrat', sans-serif;
  font-weight: 600;
  text-align: center;
`;
const Price = styled.div`
  color: #b08d57;
  font-size: 1.05rem;
  font-weight: bold;
  font-family: 'Montserrat', sans-serif;
`;
const TryBadge = styled.div`
  position: absolute;
  top: 12px;
  right: 12px;
  background: #6b6e58;
  color: #fff;
  font-size: 0.85rem;
  font-family: 'Montserrat', sans-serif;
  padding: 0.3rem 0.9rem;
  border-radius: 1rem;
  font-weight: 600;
  box-shadow: 0 2px 8px rgba(107,110,88,0.08);
`;

const products = [
  {
    name: 'Chocolate Covered Cookie-wich',
    img: 'https://images.unsplash.com/photo-1519864600265-abb23847ef2c?auto=format&fit=crop&w=300&q=80',
    price: '$6.99',
  },
  {
    name: 'Ice Cream Deluxe Cookie',
    img: 'https://images.unsplash.com/photo-1504674900247-0877df9cc836?auto=format&fit=crop&w=300&q=80',
    price: '$10.75',
    featured: true,
    tryNow: true,
  },
  {
    name: 'Ham Baguette Sandwich',
    img: 'https://images.unsplash.com/photo-1519864600265-abb23847ef2c?auto=format&fit=crop&w=300&q=80',
    price: '$18.50',
  },
  {
    name: 'Ham & Swiss Croissant',
    img: 'https://images.unsplash.com/photo-1464306076886-debca5e8a6b0?auto=format&fit=crop&w=300&q=80',
    price: '$8.99',
  },
];

export default function BestsellersSection() {
  return (
    <Section id="bestsellers">
      <SvgCurve viewBox="0 0 1440 60" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M0,60 Q720,0 1440,60 V0 H0 V60 Z" fill="#fff7ed" />
      </SvgCurve>
      <TitleRow>
        <TitleNew>New</TitleNew>
        <TitleBest>Bestseller</TitleBest>
      </TitleRow>
      <Highlights
        initial={{ opacity: 0, y: 60 }}
        whileInView={{ opacity: 1, y: 0 }}
        transition={{ duration: 1 }}
        viewport={{ once: true }}
      >
        {products.map((p, i) => (
          <Highlight
            key={p.name}
            featured={p.featured}
            initial={{ opacity: 0, y: 40 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.7, delay: i * 0.15 }}
            viewport={{ once: true }}
          >
            {p.tryNow && <TryBadge>TRY NOW</TryBadge>}
            <Img src={p.img} alt={p.name} />
            <Name>{p.name}</Name>
            <Price>{p.price}</Price>
          </Highlight>
        ))}
      </Highlights>
    </Section>
  );
}
